    "summary": "\ud83d\udc51\u00a0Hiya!\u003cdiv\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(242, 195, 20);\"\u003e\u003cem\u003e\u003cstrong\u003eWANNA BE A STAR? \u003c/strong\u003e\ud83c\udf1f\u003cbr\u003e\u003c/em\u003e\u003c/span\u003e\u003cbr\u003eFirst things first- \u003cstrong\u003eyour\u0027re my biggest fan; and none of this would be real without \u003cspan style=\"color: rgb(242, 195, 20);\"\u003eyou\u003c/span\u003e!\u003c/strong\u003e \u2764\u003cbr\u003e\u003cbr\u003eNow, second-\u00a0\u003cstrong\u003eyou do not HAVE to sign up to be a supporter\u003c/strong\u003e! There are other ways! Which we can discuss via email or my official Facebook.\u003cbr\u003e\u003cbr\u003eFacebook.com/\u003cspan style=\"color: rgb(242, 195, 20);\"\u003eIAmSashaSuperstar\u003cbr\u003eIAmSashaSuperstar\u003c/span\u003e@gmail.com\u003cbr\u003e\u003cbr\u003eThis page is for the fans\u00a0who\u003cstrong\u003e want extra exclusive *sexy* content and a first hand look at my artwork\u003c/strong\u003e! \u003cbr\u003e\u003cem\u003e\u003cbr\u003eGain access to all these juicy rewards by signing up: \u003c/em\u003e\u003cbr\u003e\u003cstrong\u003e*Behind the Scenes photoshoot photos!\u003c/strong\u003e\u003cbr\u003e\u003cstrong style=\"font-weight: bold;\"\u003e*Exclusive *lewd* photos!\u003c/strong\u003e\u003cbr\u003e\u003cstrong style=\"font-weight: bold;\"\u003e*Exclusive Patreon Snapchat access!\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e*Photo Prints!\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e*Personal Advice and sentiments, from myself!\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(242, 195, 20);\"\u003e\u003cstrong style=\"font-weight: bold;\"\u003ePlease read the FAQs Below! :)\u003c/strong\u003e\u003cbr\u003e\u003c/span\u003e\u003cbr\u003e\u003cstrong\u003e\u003cem\u003eWHO AM I?\u003c/em\u003e\u003cbr\u003e\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003eI am a \"\u003cspan style=\"background-color: rgb(242, 195, 20);\"\u003e\u003cspan style=\"background-color: rgb(255, 255, 255); color: rgb(242, 195, 20);\"\u003eSuperstar\u003c/span\u003e\u003c/span\u003e\",\u003cbr\u003e\u003cbr\u003e\"n. Bold. Ambitious. Determied. Someone that decided they wanted to have it all. // see: Goddess, Queen.\"\u003cbr\u003e\u003cbr\u003eMy Grandfather used to call me that. I\u0027ve always had big dreams of being an Artist.\u003cbr\u003e\u003cbr\u003eAnd now I am.\u003cbr\u003e\u003cbr\u003eDrawing, Painting, Modeling, and Acting- what\u0027s next? Music and Fashion Design? You guessed it!\u003cbr\u003e\u003cbr\u003eI have received so much Thanks, Love and Support, for what I do, and what I stand for- I am both flattered and thankful. \u003cbr\u003e\u003cbr\u003eSome of my other hobbies include:\u00a0 eating pizza, playing video games, drawing and painting (even tho i sell my artwork, I still do it for fun), and learing new things. \u003cbr\u003e\u003cbr\u003eI am currently a Starving Artist; you\u0027ve believed in me this far- why stop now? \ud83c\udf1f\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cdiv style=\"\"\u003e\u003cstrong\u003e\u003cem\u003eWHY PATREON?\u003c/em\u003e\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003eI have created this Patreon Page in order to help the many people that believe in and support me, do so- in an easier and more organized wayt!\u003cbr\u003e\u003cbr\u003eI love every bit of what I do, but sometimes things can get costly. \u003cbr\u003e\u003cbr\u003eBetween Painting/Designing, Acting, Modeling, and\u00a0the other many Talents and Services I give to the Art-isphere, it can be both very imely and expensive.\u003cbr\u003e\u003cbr\u003eAll of my artworks are uniquely original and are made with the very fibers of my creative essence.\u00a0I put hours of time and passion into my work and while I spend the other countless hours getting no sleep, at Go-Sees and Auditions, all while endlessly Networking, to acquire and schedule the time and funds to do the things that you admire me for! \u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cstrong\u003ePatreon allows me to give back to those who are kind enough to give to me, by allowing them access to these exclusive and personal, content and rewards! \ud83c\udf1f\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cspan style=\"\"\u003e\u003cstrong\u003eFAQ:\u003c/strong\u003e\u003cbr\u003e\u003cem\u003e\u003cstrong\u003eQ: When do I pay?\u003c/strong\u003e\u003c/em\u003e\u003cbr\u003eA: Payment is taken upon sign up for the current month. Then the beginning of each month.\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cbr\u003e\u003cem\u003e\u003cstrong\u003eQ: How do I get the photos?\u003c/strong\u003e\u003c/em\u003e\u003cbr\u003eA: Photos are sent individually to each Patron, as discussed via Patreon Message; either Digital, or Standard Mail.\u003cbr\u003e\u003cbr\u003e\u003cem\u003e\u003cstrong\u003eQ: Is there nudity or pornography?\u003c/strong\u003e\u003c/em\u003e\u003cbr\u003eA: There is no nudity or pornographic acts.\u003cbr\u003e\u003cbr\u003e\u003cem\u003e\u003cstrong\u003eQ: How do I access the Lewd List on snapchat\u003c/strong\u003e?\u003c/em\u003e\u003cbr\u003eA: My Snapcode will be sent to you upon subscription, along with the Lewd List Snapchat \"Password\" (subject to change) will be sent to you via Patreon Message. Once you have successfully followed, you will be added to the group.\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003e\u003cem\u003eQ: How long is the Magical Tour?\u003c/em\u003e\u003c/strong\u003e\u003cbr\u003eA: To fully fulfill Reward Tier, a minimum 1 hour will be spent together.\u00a0\u003c/span\u003e\u003cbr\u003e    \u003cbr\u003e\u003cstrong\u003e\u003cem\u003eQ: What are the area limitations to be on the Magical Tour?\u003c/em\u003e\u003c/strong\u003e\u003cbr\u003eA: You must live in the designated city. \u003cbr\u003e\u003cem\u003eCurrently: Pittsburgh.\u003c/em\u003e\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eIf you are not able to donate,  your support and thoughtfulness mean the world to me!\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u003c/strong\u003e\u003cstrong\u003eThanks for reading! \u003cspan style=\"color: rgb(242, 195, 20);\"\u003eXoXo\u003c/span\u003e \ud83d\udc51\u2764\u003c/strong\u003e\u003c/div\u003e\u003c/div\u003e"
